            </h4>
            {/* <Link to="/" className="scroll-to"> */}
            <div
              className="btn"
              style={{
                backgroundColor: colors.primary2,
                color: colors.white,
              }}
            >
              Let's CatchUp
            </div>
            {/* </Link> */}
          </div>
        </div>
      </div>
    </div>
  );
}

export default Home;
